import React from "react";
import Habitacion from "./components/Habitacion";
import './App.css';

class App extends React.Component{
    render(){
        
        return(
            <div className="container">
                <h1 className="mx-auto pageHeader"> Hotel SC </h1>
                <div className="container-body row">
                    <Habitacion num={1}/>
                    <Habitacion num={2}/>
                    <Habitacion num={3}/>
                    <Habitacion num={4}/>
                    <Habitacion num={5}/>

                </div>
            </div>
        )
    }
}

export default App;
